DROP TABLE Transaction, Chocolate, User;
DROP TRIGGER updateChocolateBeforeUpdate;
DROP TRIGGER updateChocolateBeforeInsert;
DROP TRIGGER updateUserBeforeUpdate;
DROP TRIGGER updateUserBeforeInsert;

CREATE TABLE `Chocolate` (
	`ChocoID` INT NOT NULL AUTO_INCREMENT,
	`Name` VARCHAR(128) NOT NULL,
	`Stock` INT NOT NULL DEFAULT '0',
	`Sold` INT NOT NULL DEFAULT '0',
	`Price` INT,
	`Description` VARCHAR(4096),
	`DateAdded` DATETIME,
	`LastModified` DATETIME,
	`ImageName` VARCHAR(150),
	UNIQUE KEY `ChocoIDIndex` (`ChocoID`) USING HASH,
	PRIMARY KEY (`ChocoID`)
);

DELIMITER $$
CREATE TRIGGER updateChocolateBeforeUpdate
BEFORE UPDATE ON `Chocolate`
FOR EACH ROW
BEGIN
	SET NEW.LastModified=NOW();
END$$
CREATE TRIGGER updateChocolateBeforeInsert
BEFORE INSERT ON `Chocolate`
FOR EACH ROW
BEGIN
	SET NEW.ImageName=CONCAT('choco',IFNULL((SELECT MAX(ChocoID) FROM `Chocolate`), 0) + 1,'.jpg');
	IF(NEW.DateAdded IS NULL) THEN
		SET NEW.DateAdded=NOW();
	END IF;
	SET NEW.LastModified=NEW.DateAdded;
END$$
DELIMITER ;

CREATE TABLE `User` (
	`UserID` INT NOT NULL AUTO_INCREMENT,
	`Username` VARCHAR(64) NOT NULL,
	`Password` VARCHAR(16) NOT NULL,
	`Email` VARCHAR(265) NOT NULL,
	`DateRegistered` DATETIME,
	`IsSuperuser` BOOLEAN NOT NULL DEFAULT '0',
	`LastModified` DATETIME,
	`SHA1` VARCHAR(40),
	UNIQUE KEY `UserIDIndex` (`UserID`) USING HASH,
	PRIMARY KEY (`UserID`)
);

DELIMITER $$
CREATE TRIGGER updateUserBeforeUpdate
BEFORE UPDATE ON `User`
FOR EACH ROW
BEGIN
	SET NEW.LastModified=NOW(),NEW.SHA1=SHA1(CONCAT(NEW.Username, NEW.Password, "anjaytubes"));
END$$
CREATE TRIGGER updateUserBeforeInsert
BEFORE INSERT ON `User`
FOR EACH ROW
BEGIN
	IF(NEW.DateRegistered IS NULL) THEN
		SET NEW.DateRegistered=NOW();
	END IF;
	SET NEW.LastModified=NEW.DateRegistered, NEW.SHA1=SHA1(CONCAT(NEW.Username, NEW.Password, "anjaytubes"));
END$$
DELIMITER ;

CREATE TABLE `Transaction` (
	`UserID` INT NOT NULL,
	`ChocoID` INT NOT NULL,
	`Amount` INT NOT NULL,
	`Date` DATETIME,
	`Address` VARCHAR(512) NOT NULL,
	FOREIGN KEY (`UserID`) REFERENCES `User`(`UserID`),
	FOREIGN KEY (`ChocoID`) REFERENCES `Chocolate`(`ChocoID`)
);

